import React from 'react';
import styles from './LogIn.module.css'

class LogIn extends React.Component {
	constructor(props) {
		super(props);
	}
	render() {

		return (
			<div className={styles.overlay}>
				<div className={styles.popup}>
					<p>Iniciar Sesi√≥n</p>
					<form className='d-flex flex-column'>
						<input className="form-control rounded-5" type="text" placeholder="username" aria-label="default input example"></input>
        		<input className="form-control rounded-5" type="password" placeholder="password" aria-label="default input example"></input>
						<div className="d-grid gap-2">
  						<button className="btn btn-primary" type="button">Ingresar</button>
						</div>
					</form>
				</div>
			</div>
		);
	}
}

export default LogIn;
